import React from "react";
import { useNavigate, BrowserRouter, Routes, Route } from "react-router-dom";
import styles from './Base.module.css'



function Base(){

    return(
        <div >
            <nav className={styles.nav}>
                <ul className={styles.ul}>
                    <li className={styles.item}><a className={styles.link} href="#">Link1</a></li>
                    <li className={styles.item}><a className={styles.link} href="#">Link2</a></li>
                    <li className={styles.item}><a className={styles.link} href="#">Link3</a></li>
                    <li className={styles.login_bar}><a href="login">login</a></li>
                </ul>


            </nav>

        </div>
    )
};

export default Base;
